import React, {Component} from 'react';
import Main from "../../Components/Main/Main";
import Contacts from "../Contacts/Contacts";

class MainPage extends Component {
    render() {
        return (
            <div className="main-page">
                <Main/>
                <Contacts/>
            </div>
        );
    }
}

export default MainPage;
